{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ibraheemraji/capstone-bikeshare?scriptVersionId=100441217\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"91aa2806","metadata":{"papermill":{"duration":0.014193,"end_time":"2022-07-10T00:51:01.559805","exception":false,"start_time":"2022-07-10T00:51:01.545612","status":"completed"},"tags":[]},"source":["#  **Google Data Analytics Project BikeShare Case Study**\n","## **Author: Ibrahim Raji**\n","\n","\n","## INTRODUCTION\n","\n","In this Fictional Scenario, I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve our recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","#### About Cyclistic\n","Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itselfapart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people withdisabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to\n","commute to work each day.\n","\n","#### StakeHolders\n","● Lily Moreno: The director of marketing and my manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","\n","● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busylearning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic\n","achieve them.\n","\n","● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve therecommended marketing program.\n","\n","\n","#### About the company\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","These project is divied into six ditinct phases where I tackle the problem logically. They are;\n","* Ask\n","* Prepare\n","* Process\n","* Analyze\n","* Share and \n","* Act"]},{"cell_type":"markdown","id":"d12d3d43","metadata":{"papermill":{"duration":0.012572,"end_time":"2022-07-10T00:51:01.584599","exception":false,"start_time":"2022-07-10T00:51:01.572027","status":"completed"},"tags":[]},"source":["# **1. ASK**\n","\n","In this Phase, I need to understand the business objective and the task at hand.\n","The business objective here is to provide answers to the following question.\n","\n","How do annual members and casual riders use Cyclistic bikes differently?\n","\n","\n","My Manager, Moreno assigned me to answer the question How do annual members and casual riders use Cyclistic bikes differently?\n","\n","I also need to know the key Stakeholders and they are:\n","\n","1. Moreno: My manger\n","\n","2. Cyclistic executive team and\n","\n","3. Cyclistic marketing analytics team\n"]},{"cell_type":"markdown","id":"e33d41b5","metadata":{"papermill":{"duration":0.012409,"end_time":"2022-07-10T00:51:01.609007","exception":false,"start_time":"2022-07-10T00:51:01.596598","status":"completed"},"tags":[]},"source":["# **2. PREPARE**\n","\n","In this phase, I download the [dataset](http://https://divvy-tripdata.s3.amazonaws.com/index.html) The last twelve month is my focus in this case April 2021 - March 2022\n","\n","The dataset is well organized, the files are saved monthly. The  dataset is Reliable,Original,Current,Comprehensive and cited which make it fit for my analysis.\n"]},{"cell_type":"markdown","id":"490af642","metadata":{"papermill":{"duration":0.012037,"end_time":"2022-07-10T00:51:01.633142","exception":false,"start_time":"2022-07-10T00:51:01.621105","status":"completed"},"tags":[]},"source":["### Setting Up my Enviroment\n","\n","I will Install and load all the packages needed to complete this project\n","1. tidyverse for data import and wrangling\n","2. Janitor for Cleaning\n","3. lubridate for date functions\n","4. ggplot for visualization\n"]},{"cell_type":"code","execution_count":1,"id":"32248452","metadata":{"execution":{"iopub.execute_input":"2022-07-10T00:51:01.663274Z","iopub.status.busy":"2022-07-10T00:51:01.660059Z","iopub.status.idle":"2022-07-10T00:52:24.630613Z","shell.execute_reply":"2022-07-10T00:52:24.628688Z"},"papermill":{"duration":82.98804,"end_time":"2022-07-10T00:52:24.633483","exception":false,"start_time":"2022-07-10T00:51:01.645443","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source"